    public int MaximumCandies(int[] candies, long k)
    {
        long sum = 0;
        for (int i = 0; i < candies.Length; i++)
        {
            sum += candies[i];
        }
        if (sum < k) return 0;
        int[] posibility = new int[candies.Max()];

        //新建一个数组，包含所有可能性答案
        for (int i = 0; i < posibility.Length; i++)
        {
            posibility[i] = i + 1;
        }

        //判断是否成功分配
        bool success = false;

        //二分参数
        int left = 0;
        int right = posibility.Length;
        int mid;
        while (left + 1 < right)
        {
            mid = left + (right - left) / 2;

            if (CheckIfSuccess(candies, k, posibility[mid])) left = mid;
            else right = mid;
        }

        return right;
    }

    bool CheckIfSuccess(int[] candies, long target, int number)
    {
        long sum = 0;
        for (int i = 0; i < candies.Length; i++)
        {
            sum += candies[i] / number;
        }

        //如果sum >= target ,说明是可以的
        return sum >= target;
    }
